// Panel 
--panel-padding-x: 16px;
--panel-padding-y: 8px;

.panel {
  background-color: white;
  border-radius: var(--radius-default);
}

.panel-heading {
  background-color: var(--palette-bg-50);
  padding: var(--panel-padding-y) var(--panel-padding-x);
};

.panel-heading__text {
  text-transform: uppercase;
  font-weight: bold;
  font-size: var(--font-size-body);
  color: var(--color-text-medium);
}

.panel-content {
  padding: var(--panel-padding-y) var(--panel-padding-x);
};

// Table
--table-border-color: var(--palette-bg-100);

.table {
  width: 100%;
  column-gap: 0;
  font-size: var(--font-size-body);

  td {
    padding: 8px 12px;
  }
}

.table-head td {
  color: var(--color-text-medium);
  border-bottom: 1px solid var(--table-border-color);
}

.table-foot td {
  border-top: 1px solid var(--table-border-color);
}

.table-pagination {
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: flex-end;
}

.table-pagination__page-counter {
  padding: 0 12px;
}

--color-utility-1: #5C9BD1;
--color-utility-2: #2ab4c0;
--color-utility-3: #8877a9;
--color-utility-4: #f36a5a;

display: grid;
grid-template-columns: repeat(auto-fill,minmax(220px,1fr));
grid-gap: 8px;
grid-auto-rows: minmax(100px,auto);

.stat-item {
  padding: 24px;
  border-radius: var(--radius-default);
  display: flex;
  align-items: flex-start;
  line-height: 1.25;
  background-color: white;

  color: var(--color-utility-1);

  &:nth-child(2n) {
  	color: var(--color-utility-2);
  }

  &:nth-child(3n) {
  	color: var(--color-utility-3);
  }

  &:nth-child(4n) {
  	color: var(--color-utility-4);
  }
}

.stat-item__content {
  flex-grow: 1;
}

.stat-item__data {
  font-size: 28px;
  color: currentColor;
}

.stat-item__data-description {
  font-size: var(--font-size-body);
  color: var(--color-text-medium);
  text-transform: uppercase;
  font-weight: bold;
}

.stat-item__image-box {
  --icon-size: 40px;

  display: flex;
  margin-top: -4px;

  &,
  & > * {
    width: var(--icon-size);
  	height: var(--icon-size);
  	background-size: var(--icon-size) auto;
  }

  & > * {
  	opacity: 0.4;
  }
}

margin: 0 auto;
