&:empty::after {
  content: "There's no tasks yet";
  color: var(--color-text-medium);
  text-align: center;
  width: 100%;
  margin: auto;
  display: block;
  padding: 32px;
}

.todo-item {
  display: flex;
  align-items: center;
  width: 100%;
  min-height: 28px;

  &:hover,
  &:focus {
    .todo-item__button-wrapper {
    	opacity: 1;
    }
  }
}

.todo-item__checkbox-wrapper {
  flex-grow: 1;

  & > * {
    width: 100%;
  }
}

.todo-item__button-wrapper {
  opacity: 0;
  transition: 150ms ease-in;
  transition-property: opacity;
  flex-shrink: 0;
}

